import React from 'react'
import Topbar from "./component/topbar/Topbar";
import Home from "./pages/home/Home";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import Settings from "./pages/settings/Settings";
import Single from "./pages/single/Single";
import Write from "./pages/write/Write";
import { BrowserRouter as Router, Routes, Route,Navigate  } from "react-router-dom";

function App() {
  const currentUser = false;
  return (
    <Router>

      <Topbar />
      <Routes>
        <Route exact path="" element={<Home />} />
        <Route exact path="posts" element={<Home />} />
        <Route  exact path="register" element = {currentUser ? ( <Home />) : (<Navigate replace to= {"register"} /> ) } />
        <Route  exact path="login" element = {currentUser ? ( <Home />) : (<Navigate replace to= {"login"} /> ) } />
        <Route exact path=" post/:id" element={<Single />} />
        <Route exact path="write" element = {currentUser ? ( <Write />) : (<Navigate replace to= {"login"} /> ) } />
        <Route exact path="settings" element = {currentUser ? ( <Settings />) : (<Navigate replace to= {"login"} /> ) } />

      </Routes>
    </Router>
  );
}

export default App;
